import { Table } from "../components";

const GAMES = [
    { id: 1, home: true, opponent: 'Sequoia', date: '2/10/22', location: '', notes: 'notes about game', goals_for: 9, goals_against: 7 },
    { id: 2, home: false, opponent: 'Peachtree Ridge', date: '2/13/22', location: '', notes: 'notes about game', goals_for: 11, goals_against: 12 }
]

const Games = () => {
console.log(GAMES)
    const headers = [
        { label: 'Date', className: 'whitespace-nowrap w-0', default: true },
        { label: '', className: 'w-0' },
        { label: 'Opponent' },
        { label: 'GF' },
        { label: 'GA' },
        { label: 'Diff' },
    ];

    const columns = {
        date: 'date',
        home: {
            type: 'boolean',
            trueValue: 'Home',
            falseValue: 'Away',
        },
        opponent: 'string',
        goals_for: 'number',
        goals_against: 'number',
        diff: 'number',
    }

    return (
        <div className="bg-pink-100">
            <div className="bg-white p-3 sm:p-6 mb-6">
                <Table
                    headers={headers}
                    columns={columns}
                    body={GAMES}
                    title="Games"
                />
            </div>
        </div>
    )
}

export default Games;
